  false,\n\t\"url\": null,\n\t\"notes\": \"In this Final Environmental Assessment,
  the United States Fish and Wildlife Service describes various alternatives that
  could provide long-term protection to the wildlife habitat on 38 islands in the
  Ohio River between Shippingport, Pennsylvania, and Manchester, Ohio (362 river miles).
  The purpose of this environmental assessment is to identify threats to the islands
  of the upper Ohio River and compare alternatives, including land acquisition by
  the Fish and Wildlife.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
